import React from 'react';

const HomePage = () => {
  return (
    <div style={styles.container}>
      <header style={styles.header}>
        <h1 style={styles.title}>Добро пожаловать на наш сайт!</h1>
      </header>
      <main style={styles.mainContent}>
        <p style={styles.text}>Здесь вы найдете множество интересной информации о нашей компании.</p>
        <p style={styles.text}>Пожалуйста, ознакомьтесь с нашими услугами и продуктами.</p>
      </main>
      <footer style={styles.footer}>
        <p style={styles.text}>© 2023 Наша компания. Все права защищены.</p>
      </footer>
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    backgroundColor: '#f0f0f0',
    padding: '10px',
  },
  header: {
    marginBottom: '50px',
  },
  title: {
    color: '#333',
    fontSize: '2.5em',
  },
  mainContent: {
    marginBottom: '50px',
  },
  text: {
    color: '#666',
    fontSize: '1.2em',
    textAlign: 'center',
  },
  footer: {
    position: 'fixed',
    left: '0',
    bottom: '0',
    width: '100%',
    backgroundColor: '#333',
    color: 'white',
    textAlign: 'center',
  },
};

export default HomePage;
